import React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { AiFillStar } from "react-icons/ai";
import Grid from '@material-ui/core/Grid';
import axios from "axios";

class SimpleTabs extends React.Component {
  constructor() {
    super();
    this.state = {
      review: [],
    };
  }

  componentDidMount() {
    axios.get(`http://localhost:8090/reviews`).then((res) => {
      const review = res.data;
      this.setState({ review });
      console.log(review);
      // const test = [{ name: "jingshuai", age: "13" }];
      //console.log(task.title);
    });
  }
  render(){
  return (
    <div className="reviews">
      <div className="title">
      REVIEWS
      </div>
      <div className="repley-display">
      <ul className="ul">
        {this.state.review.map((review) => (
          <li key={review.replyId} className="list">
            <div className="reply-header">
              <img
                src={require("https://previews.123rf.com/images/topphotoengineer/topphotoengineer1507/topphotoengineer150700297/42890959-cute-american-shorthair-kitten.jpg")}
                alt="image"
                id="reply-image"
              />
              <div className="detail-box">
                <a className="reply-name">Anthony H</a>
                <div className="star">
                  <AiFillStar color="rgb(233,165,45)" />
                  <AiFillStar color="rgb(233,165,45)" />
                  <AiFillStar color="rgb(233,165,45)" />
                  <AiFillStar color="rgb(233,165,45)" />
                  <AiFillStar color="rgb(233,165,45)" />
                  <div className="reply-score">4.9</div>
                </div>
                <div className="complete-rate">100% completed rate</div>
              </div>
            </div>
            <div className="reply-text">{review.description}</div>
          </li>
        ))}
      </ul>
    </div>
    </div>
  );
}

}

export default SimpleTabs;
